import React from 'react'
// import fullNameOnly, {myName, fName} from './components/Name'
import * as Names from './components/Name'


const Heading = ()=>{
    return (
        <>
        <h1>This is Heading</h1>
        <h1>{Names.default}</h1>
        <h1>{Names.myName}</h1>
        <h1>{Names.fName()}</h1>

        </>
    )
}

export default Heading;
